import React from 'react';
import { Card, CardContent } from '@/components/ui/card';
import { Input } from '@/components/ui/input';
import { Label } from '@/components/ui/label';
import { Button } from '@/components/ui/button';
import { Badge } from '@/components/ui/badge';
import { Calendar } from '@/components/ui/calendar';
import { Popover, PopoverContent, PopoverTrigger } from '@/components/ui/popover';
import { CalendarIcon, Play, Image } from 'lucide-react';
import { format } from 'date-fns';
import { cn } from '@/lib/utils';
import { BulkAdItem, FacebookCampaign, FacebookPage } from '@/types';

interface AdRowProps {
  item: BulkAdItem;
  campaigns: FacebookCampaign[];
  facebookPages: FacebookPage[];
  onUpdate: (id: string, updates: Partial<BulkAdItem>) => void;
  onRemove: (id: string) => void;
}

export function AdRow({ item, campaigns, facebookPages, onUpdate, onRemove }: AdRowProps) {
  const handleCampaignChange = (campaignId: string) => {
    const campaign = campaigns.find(c => c.id === campaignId);
    onUpdate(item.id, {
      campaignId,
      campaignName: campaign?.name
    });
  };

  const handleFacebookPageChange = (pageId: string) => {
    const page = facebookPages.find(p => p.id === pageId);
    onUpdate(item.id, {
      facebookPageId: pageId,
      facebookPageName: page?.name
    });
  };

  const handleBudgetChange = (value: string) => {
    const budget = parseFloat(value) || 0;
    onUpdate(item.id, { budget });
  };

  const handleStartDateChange = (date: Date | undefined) => {
    if (date) {
      onUpdate(item.id, { startDate: date.toISOString() });
    }
  };

  return (
    <Card className="mb-4">
      <CardContent className="p-4">
        <div className="grid grid-cols-12 gap-4 items-center">
          {/* Media Thumbnail */}
          <div className="col-span-2">
            <div className="relative w-20 h-20 rounded-lg overflow-hidden bg-gray-100">
              {item.media.mediaType === 'image' ? (
                <img
                  src={item.media.url}
                  alt={item.media.originalName}
                  className="w-full h-full object-cover"
                />
              ) : (
                <div className="w-full h-full flex items-center justify-center bg-gray-200">
                  <Play className="w-6 h-6 text-gray-600" />
                </div>
              )}
              <Badge 
                variant="outline" 
                className="absolute top-1 right-1 text-xs"
              >
                {item.media.mediaType}
              </Badge>
            </div>
            <p className="text-xs text-muted-foreground mt-1 truncate">
              {item.media.originalName}
            </p>
          </div>

          {/* Campaign Selection */}
          <div className="col-span-2">
            <Label className="text-xs">Campaign</Label>
            <select
              value={item.campaignId || ''}
              onChange={(e) => handleCampaignChange(e.target.value)}
              className="w-full text-sm border rounded px-2 py-1"
            >
              <option value="">Select Campaign</option>
              {campaigns.map((campaign) => (
                <option key={campaign.id} value={campaign.id}>
                  {campaign.name}
                </option>
              ))}
            </select>
          </div>

          {/* Ad Set Name */}
          <div className="col-span-2">
            <Label className="text-xs">Ad Set Name</Label>
            <Input
              value={item.adSetName}
              onChange={(e) => onUpdate(item.id, { adSetName: e.target.value })}
              className="text-sm"
              placeholder="Auto-generated"
            />
          </div>

          {/* Ad Name */}
          <div className="col-span-2">
            <Label className="text-xs">Ad Name</Label>
            <Input
              value={item.adName}
              onChange={(e) => onUpdate(item.id, { adName: e.target.value })}
              className="text-sm"
              placeholder="Auto-generated"
            />
          </div>

          {/* Budget */}
          <div className="col-span-1">
            <Label className="text-xs">Budget</Label>
            <Input
              type="number"
              value={item.budget}
              onChange={(e) => handleBudgetChange(e.target.value)}
              className="text-sm"
              placeholder="0.00"
            />
          </div>

          {/* Start Date */}
          <div className="col-span-2">
            <Label className="text-xs">Start Date</Label>
            <Popover>
              <PopoverTrigger asChild>
                <Button
                  variant="outline"
                  className={cn(
                    "w-full justify-start text-left font-normal text-sm",
                    !item.startDate && "text-muted-foreground"
                  )}
                >
                  <CalendarIcon className="mr-2 h-4 w-4" />
                  {item.startDate ? format(new Date(item.startDate), "PPP") : "Pick a date"}
                </Button>
              </PopoverTrigger>
              <PopoverContent className="w-auto p-0">
                <Calendar
                  mode="single"
                  selected={item.startDate ? new Date(item.startDate) : undefined}
                  onSelect={handleStartDateChange}
                  initialFocus
                />
              </PopoverContent>
            </Popover>
          </div>

          {/* Facebook Page */}
          <div className="col-span-1">
            <Label className="text-xs">Page</Label>
            <select
              value={item.facebookPageId || ''}
              onChange={(e) => handleFacebookPageChange(e.target.value)}
              className="w-full text-sm border rounded px-2 py-1"
            >
              <option value="">Select Page</option>
              {facebookPages.map((page) => (
                <option key={page.id} value={page.id}>
                  {page.name}
                </option>
              ))}
            </select>
          </div>

          {/* Remove Button */}
          <div className="col-span-1">
            <Button
              variant="outline"
              size="sm"
              onClick={() => onRemove(item.id)}
              className="text-red-600 hover:text-red-700"
            >
              Remove
            </Button>
          </div>
        </div>
      </CardContent>
    </Card>
  );
}
